import React from "react";

import { Link } from "react-router-dom";
import BandB_SContainer from "../components/B&BContainer";
const BandB_S = () => {
  return (
    <>
      
          <Link to="/" className="btn-primary">
            return home
          </Link>
     
      <BandB_SContainer />
    </>
  );
};

export default BandB_S;
